import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link, useNavigate, useParams } from "react-router-dom";
import MatchFilter from "../teames/MatchFilter";
export default function Team() {
  const [teams, setTeams] = useState([]);
  const { teamid } = useParams();

  useEffect(() => {
    loadTeams();
  }, []);
  const loadTeams = async () => {
    const result = await axios.get("http://localhost:8080/getteam");
    setteames(result.data);
  };
//   const filterMatches = async (filters) => {
//     let url = '/api/teames/filter?';
//     if (filters.city) {
//         url += `city=${filters.city}&`;
//     }
//     if (filters.team) {
//         url += `team=${filters.team}&`;
//     }

//     const result = await axios.get(url);
//     setteames(result.data);
// };

  const deleteTeam = async (teamid) => {
    await axios.delete(`http://localhost:8080/team/${teamid}`);
    loadTeams();
  };
  return (
    <div className="container">
      <div className="py-4">
        <table className="table">
          <thead>
            <tr>
              <th scope="col">Sl.no</th>
              <th scope="col">Team_id</th>
              <th scope="col">Team_name</th>
              <th scope="col">Captain</th>
              <th scope="col">Head_coach</th>
              <th scope="col">Homeground</th>
              <th scope="col">Action</th>
            </tr>
          </thead>
          <tbody>
            {teams.map((team, index) => (
              <tr>
                <th scope="row" key={index}>
                  {index + 1}
                </th>
                <td>{team.teamid}</td>
                <td>{team.team_name}</td>
                <td>{team.captain}</td>
                <td>{team.head_coach}</td>
                <td>{team.homeground}</td>
                <td>
                  <Link
                    className="btn btn-primary mx-2"
                    to={`/editteam/${team.id}`}
                  >
                    Edit
                  </Link>
                  <button
                    className="btn btn-danger mx-2"
                    onClick={() => deleteTeam(team.id)}
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
